import React from 'react';
import '../css/item.css';

function Item({ item }) {
	return (
		<div className='item-card'>
			<div
				style={{ backgroundImage: 'url(/warehouse.png)' }}
				className='item-img'></div>
			<div className='item-information'>
				<h2 className='item-name'>Oc</h2>
				<div className='status in-store'>Status</div>
			</div>
			<div className='item-actions'>
				<div className='btn btn-primary'>Sell</div>
				<div className='btn'>Buy new</div>
			</div>
		</div>
	);
}

export default Item;
